import React from "react";
import { Tile } from "../tile/Tile";

export const TileList = ({contactsList}) => {
  if (!contactsList) {
    return null;
  }
  return (
    
    <div> 
     { contactsList.map((item, index) => {
       const {name, ...rest} = item;
       return <Tile name={item.name} key={index} description = {{...rest}}/>;
  })};
      
    </div>
  );
};
